measurements.description:
Thirty-seven flowers and 26 buds on twelve upright inflorescences up to 29 cm; 
a beautifully grown plant 67 cm by 70 cm, grown in bark in a 22-cm diameter x 14-cm round plastic pot;
sepals and petals white, sepals lanceolate, lavender spots adaxially, petals ovate, apiculate, undulate, lavender marginal markings abaxially; 
lip white overlaid lavender, spotted and heavily veined darker lavender; 
substance medium; texture crystalline.
